import React from 'react';

const Chart = ({ type, data, labels, analyticsInitialized }) => (
  <div style={{ padding: 20, border: '1px dashed #ccc', textAlign: 'center' }}>
    <strong>Chart Placeholder</strong>
    <div>Type: {type}</div>
    <div>Data: {JSON.stringify(data)}</div>
    <div>Labels: {JSON.stringify(labels)}</div>
    <div>Analytics Initialized: {String(analyticsInitialized)}</div>
  </div>
);

export default Chart;
